[[questions]]
id = "PAVFR062"
question = "Hur beskriver Mattus (2008) läsarens makt i förhållande till texten?"
answer = "Mattus (2008) svar på denna fråga är att läsaren har möjlighet att förflytta sig mellan olika aktörers uppfattningar av verkligheten. Läsaren har därmed frihet att tolka innehållet och bestämma vilka av uppfattningarna som är trovärdiga"
difficulty = "Medium"
category = "Art"
